import * as React from "react"
import {Table} from "@material-ui/core";
import TableContainer from "@material-ui/core/TableContainer";
import StyledTableBody from "./StyledTableBody";
import SearchResultsTableHead from "./TableHeadWithSort";
import TableHeadWithoutSort from "./TableHeadWithoutSort";

const ResultsTable = (page: any) => {
    return(
        <TableContainer>
            <Table>
                <colgroup>
                    <col style={{width:'40%'}}/>
                    <col style={{width:'20%'}}/>
                    <col style={{width:'20%'}}/>
                    <col style={{width:'20%'}}/>
                </colgroup>
                {page.value === "search" &&
               <SearchResultsTableHead />}
                {page.value === "crew" &&
                <TableHeadWithoutSort />}
               <StyledTableBody/>
            </Table>
        </TableContainer>

    )}

export default ResultsTable;
